import MainMenu from './MainMenu'


export default class Nav extends React.Component{

    state={
        display: none
    }

    render(){
        return(
            <div id="Nav">
                <div>
                    <i id="ChanceLogo" className="icon" />
                </div>
                <div>
                    <a className="dropdownMenu" href="#">☰MENU☰</a>
                </div>
                <MainMenu onClick={this.clickHandler} display={this.state.display} />
            </div>
        )
    }
}
